import React from 'react'
import NavItem from '../components/navigation/NavItem.jsx';
import calendar_img from '../img/calendar.svg'


const About = ({ btnNumClick, setbtnNumClick, modalActive, active, setModalActive }) => {


    return (

        <main>
            <div className="container">
                <div className="btn_window_container">
                </div>
                <NavItem btn_name={"ИСТОРИЯ"} btnNum={btnNumClick} setBtnNum={setbtnNumClick} active={modalActive} setActive={setModalActive} nav_num={2} nav_img={calendar_img} />

            </div>
        </main>
    )
}

export default About;
